import React,{useState} from "react";

export default function ResetPassword(props) {

  const [newPassword,setNewPassword] = useState('');
  const [confirmNewPassword, setConfirmNewPassword] = useState('');
  const isEnabled = (newPassword === confirmNewPassword);
  console.log(props)

  return (
    <div className="content_rgt">
      <div className="register_sec">
        <h1>Reset Password</h1>
        <form>
          <li>
            <span>Enter New Password</span>
            <input
              type="password"
              placeholder="Enter your new password"
              onChange={(event) => {
                setNewPassword(event.target.value);
              }}
            />
          </li>
          <li>
            <span>Confirm Password</span>
            <input
              type="password"
              placeholder="Enter your password again"
              onChange={(event) => {
                setConfirmNewPassword(event.target.value);
              }}
            />
          </li>
          {
            newPassword !== confirmNewPassword && confirmNewPassword.length>0?(
              <span className='red'>Passwords do not match</span>
            ):null
          }
          <li>
            <input type="submit" defaultValue="Submit" disabled={!isEnabled}/>
          </li>
        </form>
      </div>
    </div>
  );
}
